INSERT INTO `681_options` VALUES (236558,'cerber_admin_info','<h1>Highlights from WP Cerber Security 8.6.7</h1><ul><li>New: In the professional version of WP Cerber, you can now permit user registrations for IP addresses in the White IP Access List only.</li><li>New: All URLs in the logs are displayed in a shortened form without the websites domain.  There is no much value having see known things.</li><li>New: A new label &quot;IP Whitelisted&quot; with green borders has been introduced. It is displayed in a log row on the Live Traffic if the IP address was in White IP Access List, but the appropriate setting Use White IP Access List was not enabled at the moment when the event was logged.</li><li>New: If you now hover the mouse over a red square icon in the Activity or Live Traffic log, you see the reason why the IP address in the row is currently locked out.</li><li>New: If you now hover the mouse over a green or black square Access List icon in the Activity or Live Traffic log, you see the comment youve previously specified for that Access List entry.</li><li>Improved: All non-REGEX entries <a href=\"https://wpcerber.com/using-list-of-prohibited-logins-to-catch-stupid-bots/\" target=\"_blank\">in the list of prohibited usernames (logins)</a> are case-insensitive now. This applies to standard Latin-based (ASCII) WordPress usernames only.</li><li>Improved: The name of a group in the Group column on <a href=\"https://wpcerber.com/manage-multiple-websites/\" target=\"_blank\">Cerber.Hubs</a> website list is a link that takes you to the list of websites in the group.</li></ul><p style=\"margin-top: 18px; font-weight: bold;\"><span class=\"dashicons-before dashicons-info\"></span>  &nbsp; <a href=\"https://wpcerber.com/?plugin_version=8.6.7\" target=\"_blank\">Read more on wpcerber.com</a></p>  <h2 style=\"margin-top: 28px;\">Cerber needs your support to keep moving forward</h2>\r\n                    <p style=\"margin-top: 20px;\">\r\n                    By sharing your unique opinion on WP Cerber, you will help the engineers behind the plugin make greater progress and help other professionals find the right software. You can leave your review on one of the following websites. No needs to use English. Feel free to use your native language. Thanks!\r\n                    </p>\r\n                    \r\n                    \r\n                    <p><a href=\"https://www.trustpilot.com/review/wpcerber.com\" target=\"_blank\">Trustpilot</a> &nbsp;/&nbsp; \r\n                    <a href=\"https://www.g2crowd.com/products/cerber-security-antispam-malware-scan/\" target=\"_blank\">G2.COM</a> &nbsp;/&nbsp; \r\n                    <!-- <a href=\"https://reviews.capterra.com/new/187653\" target=\"_blank\">Capterra</a></p> -->\r\n                    \r\n                    <!--<p><a href=\"https://www.trustpilot.com/review/wpcerber.com\" target=\"_blank\">Trustpilot</a></p>\r\n                    <p><a href=\"https://www.g2crowd.com/products/cerber-security-antispam-malware-scan/\" target=\"_blank\">G2.COM</a></p>\r\n                    <p><a href=\"https://reviews.capterra.com/new/187653\" target=\"_blank\">Capterra</a></p>\r\n                    -->\r\n	        <p style=\"text-align:right; padding-right: 20px;\">\r\n    		    <input type=\"button\" class=\"button button-primary cerber-dismiss\" value=\" &nbsp; Awesome! &nbsp; \"/></p>','no');
