INSERT INTO `681_postmeta` VALUES (2093,260,'_field_3','It is with great pleasure that I am writing to recommend Olivia Etherton to you as a potential candidate for Lincoln GOLD. I have known Olivia since the 2009-2010 school year when she was a student in my fifth grade mathematics and language arts classes, and have since had the privilege of watching her grow into a hard-working, mature young woman. Olivia is an intelligent, dedicated and extremely driven student. Her commitment to learning combined with her passion for serving is unmatched among her peers. With her desire for excellence and her uncompromising commitment to personal growth, Olivia is a perfect fit for Lincoln GOLD. Additionally, as someone who is in the field of education, I know that the experience that Olivia will gain through this opportunity will broaden her horizons and help to shape her future while empowering her to make a real difference with her life. ');
