INSERT INTO `681_postmeta` VALUES (2194,269,'_field_3','Makenzie is an outstanding student and leads by example at Lincoln East High School.  Makenzie is a competitive swimmer year round, and a member of the Lincoln East Varsity Swim Team.  Makenzie has contributed to the success of the team through her leadership outside of the pool as well as her dedication at practice and in the classroom.  Makenzie was a state meet qualifier and placed in multiple events, earning her Varsity letter the first year on the team.  Makenzie is supported by her parents, Scott and Lora, who have raised Makenzie to live by the mission of Lincoln GOLD, and would be a valuable asset to the organization.');
