INSERT INTO `681_postmeta` VALUES (2218,270,'_field_3','I have had the privilege of knowing Sophia since the fall of 2015 when she was selected to be a participant in Youth Leadership Lincoln (YLL). YLL has a mission of civic engagementit seeks to enhance knowledge and develop leadership skills in a diverse group of students that empower and motivate them to become involved in and committed to their community.\r\n\r\nSophia is a a natural a group participant and considerate of others. I have observed that her contributions to discussions are well-timed and constructive, that she builds upon the perspectives of others and seeks to draw in everyone (her skills as a facilitator grow everyday). She is sensitive and generous and open-hearted. She has been an asset to YLL and will be an asset to Lincoln G.O.L.D. as well.');
