INSERT INTO `681_postmeta` VALUES (2670,328,'_field_3','I have watched Brooke grow for the past year and one half. She is currently the Miss High School Nebraska and since earning that title, she has met with state legislators, school administrators and students and implementing an anti-bullying program in schools called B.R.A.V.E. \r\n\r\nShe has started her own blog, encouraging positive exchanges between young girls who have been bullied. She works very hard with me through her Springboard training and always does her homework. \r\n\r\n**I can get her school activities if needed. ');
