INSERT INTO `681_postmeta` VALUES (2740,332,'_field_3','Kylie is involved and many different leadership opportunities.  She has served as a student council member in her school since 6th grade.  She was chosen by peers and teachers to become a member in Nebraska Human Resources Institute at the University of Nebraska.  This is an organization that pairs college student with 1st-12th grade students in LPS. She has had the opportunity to grow and build upon her leadership abilities. She has been recently been volunteering with the local VFW and has helped out with the Nebraska Heart Association. She has the ability to communicate with others very well and always has a positive lookout in challenges. She also is very keen is feeling empathy for others with others around her. She is such a great role model to her younger family members. ');
