INSERT INTO `681_postmeta` VALUES (6766,839,'_field_3','Myah would be an excellent addition to the Lincoln G.O.L.D. organization for several reasons.  First, she has been on my dance team, the Lincoln Northeast Star Strutters, for two years now.  During her time on the team, she has constantly exhibited strong leadership skills, a high maturity level, and willingness to help her teammates with anything they may need.  She is highly regarded among the Lincoln Northeast student body, and many students look up to her as a person and admire her accomplishments as a dancer, a band member, and a student in the classroom.  Finally, she is always happy and willing to help with various fundraiser and community service opportunities, going above and beyond what is required of her.  I feel Myah would positively impact the Lincoln community with the skills she exhibits on a daily basis at Lincoln Northeast.  Thank you for considering this nomination!');
