INSERT INTO `681_postmeta` VALUES (6785,840,'_field_3','I would like to nominate Eden for the Lincoln G.O.L.D. program because Eden possesses many wonderful qualities and traits that would be beneficial to the program.  She has been a member of the Lincoln Northeast Star Strutters for two years.  During this time, she was someone who always had a positive personality, a consistently strong work ethic, and exuded numerous amounts of respect towards me and her teammates alike.  Eden was one of the students selected to be a representative for the &quot;Always in Uniform&quot; program, a program made up of LNE students who are involved in athletics or activities and that make healthy lifestyle (abstaining from drug and alcohol use) and positive leadership choices.  Eden also is a strong student in the classroom and makes academics a priority.  Finally, Eden enjoys being involved in community service projects as a part of LNE and is always willing to lend a hand.  With all of these wonderful traits, I feel Eden would make an amazing Lincoln G.O.L.D. girl representative.  Thank you for considering this nomination!  ');
