INSERT INTO `681_postmeta` VALUES (6861,844,'_field_3','Maci is incredibly driven and goal-oriented. She strives to be her best and encourages the same in others. Maci will begin her junior year next month at Lincoln Southwest. She is a third year cheerleader, serving as captain last year, while also maintaining a 4.0 GPA. She volunteers as an assistant counselor at Camp Sonshine and as a leader for Vacation Bible School. This summer, she was selected for the CHI Health Summer camp, shadowing hospital personnel at CHI facilities in Lincoln. This was important to her as she is focused on working in pediatric oncology. \r\nShe also started her own online business when she was just 13 years old - Maci&#039;s Monograms. She started designing items for friends, but her success  quickly grew. Last year, she made close to 100 personalized water bottles for dancers in the Nutcracker.  \r\nMaci is a role model and leader, going the extra mile in everything she does.  I think she would be an incredible addition to the Lincoln Gold program. \r\n');
