INSERT INTO `681_postmeta` VALUES (8465,967,'_field_3','Rachel is an outgoing, smart and charming leader. She makes a positive impact in every program she gets involved in. She is a top student and is involved in the chorus program at Pius. In addition she has been a leader in Girl Scouts, dance, chorus and in her youth group at church. As the daughter of a career Naval officer, she has moved frequently and has been exposed to many different cities, leaders and schools. Her background and experience would bring new thoughts and a wide perspective to the table.');
