INSERT INTO `681_postmeta` VALUES (8855,976,'_field_3','Imaniji has overcome many obstacles in her young life. Born addicted and adopted at birth. Raised by single mother of four children.  3 boys and 1 girl.  3 out of those 4 were adopted. Her entire academic career she was SPED student and IEP . She began her educational journey at age of 3yrs old. ECSE. She overcame and graduated early. She walked stage May 2019 and gave the Graduation Speech. She was featured by LPS.org and Indian Education for accomplishment. Celebrated her Graduation Celebration at Lincoln Indian Center where she honored her fellow LPS Native Graduates 40+ students with a honorary dinner and celebration. She expressed individually to her fellow Native Students Graduates by encouraging them to continue their education.\r\nhttps://www.lps.org/post/detail.cfm?id=13727ttp://docushare.lps.org/docushare/dsweb/Get/Document-2558135/2019%20Summer%20AIYD%20Newsletter%20-%20Roxana%20Luna.pdf');
