INSERT INTO `681_postmeta` VALUES (8874,977,'_field_3','I believe that Abby will make a positive impact as a Lincoln G.O.L.D. member due to her willingness to help others around her as well as to go above what is required for daily tasks.  She keeps a busy schedule, but she uses her time to help others as well. During the summer she runs a girl empowerment program at the Salvation Army to help younger girls learn skills to help combat bullying as well as gain self-confidence.  She is very dedicated to empowering others all around the world as well as the people around her.  She is a key part of Girl Up LPS and Girl Up Nebraska and she uses her platform to help others through encouraging events and actions.  I believe as a G.O.L.D. member, Abby will learn and gain important leadership roles to spread to younger girls and to help better those around her. ');
