INSERT INTO `681_postmeta` VALUES (10572,1095,'_field_3','Bethany Everts is one of the most selfless and inspiring people I know. I have known her for 10 years and throughout this time of knowing her I know that she is the type of person that wants to pursue great things in life and uses all of her skills to help for the greater good. As a young lady Bethany loves such things as basketball, volunteering at church activities, participating in cross country and track, being a member of the band, and helping others in her community by donating her time. Everything that Bethany does I believe she does with a passion and because she has a genuine love for it, thus having her as a G.O.L.D.  girl would mean that she would put her heart and soul into this organization. Bethany is a beautiful soul that I know would be an asset to this organization and would make a positive impact. Her loving demeanor and acceptance towards all makes her an outstanding person to be around and work with. As a community member she is the cream of the crop and does whatever she can to help this community thrive. I am 100% certain that she would make a positive impact as a GOLD member due to her passion, drive, enthusiasm for doing all she can, her selflessness, and her bubbly personality that is infectious to all she meets. I strongly believe that this is a person that you need to be a GOLD girl. ');
