INSERT INTO `681_postmeta` VALUES (10591,1096,'_field_3','I think that Bethany will make a positive impact as a Lincoln G.O.L.D. member because I have been friends with her since we were in Kindergarten and thus have watched her grow up. I watched as she took the chance to volunteer at our church many times and consistently put her all into her work to make sure that the maximum amount of people are reached. She is compassionate to others when they need her help and personally takes it upon herself to make sure that not only are her friends happy but also that all those in her community are happy as well. She has taken the mediator position between our friends when they fight and continues to help dissolve the situation. She tries and succeeds in being her best self and she helps others be their best selves as well.');
