INSERT INTO `681_postmeta` VALUES (10648,1099,'_field_3','It was a delight of have Bethany Everts as a former student in my classroom!  I wish it could have been for more than one year!  I see one of Bethany&#039;s greatest strengths is her positive interactions with students and adults.  Her calm, warm and confident manner helped create a close knit classroom.  Bethany is a leader and quickly become one of my best allies!  She talked the rest of the class to memorize President Lincoln&#039;s Gettysburg Address, which was not a small undertaking!\r\n\r\nMiss Everts also bubbles over with enthusiasm and an optimistic attitude.  Although Bethany was quieter then some of the other students, she reached every single student in our classroom.  She has quite the ability to draw people out and connect with them. Bethany&#039;s sense of humor has also benefitted her more times than even she probably knows.  She has continued to stay in touch with me and arranges get-togethers so I can connect with other former students.\r\n\r\nAcademics are another strong suit of Bethany Everts.  She is excited to learn and strived to be her best under her own motivation.  I expect to see Bethany continue to be the best she can be and make anyone that knows her proud.\r\n\r\nI am honored to make this nomination.\r\nKathy Ayars');
