INSERT INTO `681_postmeta` VALUES (10667,1100,'_field_3','Camden would make positive impact as a Lincoln G.O.L.D. member because of her amazing leadership characteristics.  I have known her for so long and she has always been incredibly trustworthy, kind, and considerate of others.  She went to Launch Leadership so she has some experience with leadership camps and other activities as well, which would only strengthen this group and she can help others grow around her as well.  Lincoln G.O.L.D. is passionate about helping others, and I think that Camden would be great at this because she cares so much about every single person in her life and makes sure that she is there for them whenever they need it.  Camden has always had a passion for helping others, and in the past she has volunteered at Country House Memory Center to play her violin for the residents there.  If Camden is involved in something, whether it is something at school or her church, she gives it her all.  She has a big heart and a goofy sense of humor which would make a huge positive impact just by itself.  She is a beautiful person, inside and out, smart, level-headed, polite, generous, loyal, fair, and I think she fits in perfectly with the characteristics of this group.  I truly cannot say enough good things about her. ');
