INSERT INTO `681_postmeta` VALUES (11011,1118,'_field_3','Maddie is a talented, well rounded young woman. She is not only passionate about making sure that the world is a better place, she is kind, charismatic, and wants the best for everyone. Maddie is the kind of young woman who will change the world. She is a hard worker and is someone am so thrilled to have known since she was a very young child. Maddie has the ability to relate well to other people and be able to interact and engage with people from all different circles.  I am honored to nominate her to be a G.O.L.D member. ');
