INSERT INTO `681_postmeta` VALUES (11030,1119,'_field_3','Madelyn (Maddie) Ames exhibits the qualities of leadership and civic sensibilities that are expected of a Lincoln G.O.L.D. member throughout her educational and personal life.  Maddie is fully engaged and active within her school, Pius X High School of Lincoln.  Her extracurricular activities include feature twirler and member of the Pius X Marching Band, copy editor and journalist for the Pius X school newspaper, paper editor and member at the school Writing Resource Center, and a member of both the Passport to Adventure Club and National Honor Society.  In addition to her extracurricular activities, Maddie also provides support to the Pius X administration as an office assistant.  Outside of school, Maddie is an active member of the Blessed Sacrament Catholic Church and serves on the Church Decorating Committee.  She also maintains part-time employment at Scheels as an associate.\r\n\r\nWhile all of the civic engagement and extracurricular activities listed previously are impressive, what is most remarkable about Maddie is her ability to balance these activities with her education as evidenced by her 4.0 GPA.  Her academic excellence has been recognized through her receipt of the Dianne Sizemore Scholarship at Pius X High School.  Additionally, Maddie is an avid reader and writer.  During her time at home, Maddie maintains a book focused Instagram page and a book review website.  Her ability as a writer was recognized by an invitation to the Journalism Education Association Journalism Convention, which she attended in Washington DC, in November 2019.\r\n\r\nMaddie is an upstanding young woman who exhibits leadership ability in her school and community.  In addition to working hard for her community, particularly her faith-based community, Maddie has exhibited her organizational and time management abilities by excelling academically and socially. She is an outgoing, joyful young woman who works well with others and is an effective communicator and proficient writer. As a member of Lincoln G.O.L.D., I am confident Maddie will serve as an exemplary member and will be an asset to the organization. ');
