INSERT INTO `681_posts` VALUES (7,1,'2016-01-20 06:22:14','2016-01-20 12:22:14','[mk_page_section bg_image=\"http://lincolngold-040575ad347751584312-20200909214338.local/wp-content/uploads/2016/01/IMG_3832.jpg\" attachment=\"fixed\" bg_position=\"center top\" bg_stretch=\"true\" enable_3d=\"true\" min_height=\"600\" full_width=\"true\" sidebar=\"sidebar-1\"][vc_column][/vc_column][/mk_page_section][mk_page_section bg_color=\"#b3a263\" bg_stretch=\"true\" padding_top=\"25\" sidebar=\"sidebar-1\"][vc_column width=\"2/3\"][mk_fancy_title color=\"#ffffff\" size=\"30\" font_weight=\"400\" font_style=\"normal\" txt_transform=\"none\" margin_top=\"50\" margin_bottom=\"40\" font_family=\"none\"]Meet our 2020 Gold Girls![/mk_fancy_title][/vc_column][vc_column width=\"1/3\"][vc_empty_space height=\"40px\"][mk_button dimension=\"savvy\" size=\"large\" url=\"http://lincolngold-040575ad347751584312-20200909214338.local/2020-gold-girls/\" align=\"center\" outline_skin=\"light\"]2020 Gold Girls[/mk_button][/vc_column][/mk_page_section][vc_row][vc_column][vc_column_text]\r\n\r\n[/vc_column_text][vc_empty_space height=\"50px\"][/vc_column][/vc_row][vc_row][vc_column width=\"1/3\"][vc_column_text]\r\n<div class=\"\" style=\"text-align: center;\"><span class=\"\">Lincoln G.O.L.D. is a leadership development and community engagement program for high school junior and senior girls. Lincoln G.O.L.D was formed by people who are passionate about preparing young women for success and making college more attainable for students with leadership aspirations and civic sensibilities.</span></div>\r\n<div class=\"\" style=\"text-align: center;\"><span class=\"\"></span></div>\r\n<div class=\"\" style=\"text-align: center;\"><span class=\"\">501c(3)</span></div>\r\n[/vc_column_text][/vc_column][vc_column width=\"1/3\"][vc_video link=\"https://youtu.be/-0Z4yHqgJ0s\"][/vc_column][vc_column width=\"1/3\"][vc_column_text]\r\n<h4 style=\"text-align: center;\">Board Members</h4>\r\n<div class=\"\" style=\"text-align: center;\"></div>\r\n<div class=\"\" style=\"text-align: center;\">Robin Netz, Founder &amp; Chairperson</div>\r\n<div class=\"\" style=\"text-align: center;\">Dr. Doug Netz, Nebraska Heart Institute</div>\r\n<div class=\"\" style=\"text-align: center;\">Greg Dorff, Lexus of Lincoln</div>\r\n<div class=\"\" style=\"text-align: center;\">Brian Wolford, Midwest Bank</div>\r\n<div class=\"\" style=\"text-align: center;\">Morgan Netz,Holmes Murphy</div>\r\n<div class=\"\" style=\"text-align: center;\">\r\n<div class=\"m_-7719981474803090244gmail-\">Sue Bath, Gallup</div>\r\n<div class=\"m_-7719981474803090244gmail-\">Meghan Ehrke, Select Style</div>\r\n<div class=\"m_-7719981474803090244gmail-\">Jennifer Jensen, Pinnacle Bank</div>\r\n<div class=\"m_-7719981474803090244gmail-\">Sydney Mickells</div>\r\n</div>\r\n<div class=\"\" style=\"text-align: center;\"></div>\r\n[/vc_column_text][/vc_column][/vc_row][vc_row][vc_column][vc_empty_space height=\"50px\"][/vc_column][/vc_row][mk_page_section bg_color=\"#b3a263\" bg_stretch=\"true\" padding_top=\"25\" sidebar=\"sidebar-1\"][vc_column width=\"2/3\"][mk_fancy_title color=\"#ffffff\" size=\"30\" font_weight=\"400\" font_style=\"normal\" txt_transform=\"none\" margin_top=\"50\" margin_bottom=\"40\" font_family=\"none\"]Congratulations to our 2020 Scholarship Winners![/mk_fancy_title][/vc_column][vc_column width=\"1/3\"][vc_empty_space height=\"40px\"][mk_button dimension=\"savvy\" size=\"large\" url=\"http://lincolngold-040575ad347751584312-20200909214338.local/2020-scholarship-winners/\" outline_skin=\"light\"]2020 Scholarship Winners[/mk_button][/vc_column][/mk_page_section][vc_row][vc_column][mk_padding_divider size=\"30\"][/vc_column][/vc_row][vc_row][vc_column][vc_column_text]\r\n<p style=\"text-align: center;\">Sponsored In Part By:</p>\r\n[/vc_column_text][mk_image src=\"http://lincolngold-040575ad347751584312-20200909214338.local/wp-content/uploads/2016/01/Lexus-of-Lincoln-Logo.jpg\" image_size=\"full\"