INSERT INTO `681_posts` VALUES (592,4,'2017-03-19 20:54:10','2017-03-20 02:54:10','[mk_page_section bg_image=\"http://lincolngold-040575ad347751584312-20200909214338.local/wp-content/uploads/2016/01/goldcover.jpg\" attachment=\"fixed\" bg_position=\"center top\" bg_stretch=\"true\" enable_3d=\"true\" min_height=\"600\" full_width=\"true\" sidebar=\"sidebar-1\"][vc_column][/vc_column][/mk_page_section][mk_page_section bg_color=\"#b3a263\" bg_stretch=\"true\" padding_top=\"25\" sidebar=\"sidebar-1\"][vc_column width=\"2/3\"][mk_fancy_title color=\"#ffffff\" size=\"30\" font_weight=\"400\" font_style=\"normal\" txt_transform=\"none\" margin_top=\"50\" margin_bottom=\"40\" font_family=\"none\"]We are currently accepting scholarship applications[/mk_fancy_title][/vc_column][vc_column width=\"1/3\"][vc_empty_space height=\"40px\"][mk_button dimension=\"savvy\" size=\"large\" url=\"http://lincolngold-040575ad347751584312-20200909214338.local/scholarships/\" align=\"center\" outline_skin=\"light\"]Apply Now[/mk_button][/vc_column][/mk_page_section][vc_row][vc_column][vc_column_text]\r\n<p style=\"text-align: center;\">Lincoln G.O.L.D. congratulates its 20 inaugural scholarship winners!</p>\r\n[/vc_column_text][vc_empty_space height=\"50px\"][/vc_column][/vc_row][vc_row][vc_column width=\"1/3\"][vc_column_text]\r\n<div class=\"\" style=\"text-align: center;\"><span class=\"\">Lincoln G.O.L.D. is a new leadership development and community engagement program for high school junior and senior girls. Lincoln G.O.L.D was formed by people who are passionate about preparing young women for success and making college more attainable for students with leadership aspirations and civic sensibilities.</span></div>\r\n<div class=\"\" style=\"text-align: center;\"><span class=\"\"></span></div>\r\n<div class=\"\" style=\"text-align: center;\"><span class=\"\">501c(3)</span></div>\r\n[/vc_column_text][/vc_column][vc_column width=\"1/3\"][vc_video link=\"https://youtu.be/-0Z4yHqgJ0s\"][/vc_column][vc_column width=\"1/3\"][vc_column_text]\r\n<h4 style=\"text-align: center;\">Board Members</h4>\r\n<div class=\"\" style=\"text-align: center;\"></div>\r\n<div class=\"\" style=\"text-align: center;\">Robin Netz, Founder &amp; Chairperson</div>\r\n<div class=\"\" style=\"text-align: center;\">Dr. Doug Netz, Nebraska Heart Institute</div>\r\n<div class=\"\" style=\"text-align: center;\">Greg Dorff, Lexus of Lincoln</div>\r\n<div class=\"\" style=\"text-align: center;\">J. Hoffman, CHI Nebraska Heart</div>\r\n<div class=\"\" style=\"text-align: center;\">Morgan Netz, Chi Omega National Consultant</div>\r\n<div class=\"\" style=\"text-align: center;\"></div>\r\n[/vc_column_text][/vc_column][/vc_row][vc_row][vc_column][vc_empty_space height=\"50px\"][/vc_column][/vc_row][mk_page_section bg_color=\"#b3a263\" bg_stretch=\"true\" padding_top=\"25\" sidebar=\"sidebar-1\"][vc_column width=\"2/3\"][mk_fancy_title color=\"#ffffff\" size=\"30\" font_weight=\"400\" font_style=\"normal\" txt_transform=\"none\" margin_top=\"50\" margin_bottom=\"40\" font_family=\"none\"]Nominate a 2017-2018 Gold Girl[/mk_fancy_title][/vc_column][vc_column width=\"1/3\"][vc_empty_space height=\"40px\"][mk_button dimension=\"savvy\" size=\"large\" outline_skin=\"light\"]Nominate[/mk_button][/vc_column][/mk_page_section][vc_row][vc_column][mk_padding_divider size=\"30\"][/vc_column][/vc_row][vc_row][vc_column][vc_column_text]\r\n<p style=\"text-align: center;\">Sponsored In Part By:</p>\r\n[/vc_column_text][mk_image src=\"http://lincolngold-040575ad347751584312-20200909214338.local/wp-content/uploads/2016/01/Lexus-of-Lincoln-Logo.jpg\" image_size=\"full\" link=\"http://www.lexusoflincoln.com/\" align=\"center\"][vc_empty_space height=\"10px\"][vc_column_text][/vc_column_text][mk_button dimension=\"savvy\" size=\"medium\" url=\"http://lincolngold-040575ad347751584312-20200909214338.local/sponsors/\" align=\"center\"]View All Sponsors[/mk_button][/vc_column][/vc_row]','Home','','inherit','clos