INSERT INTO `681_posts` VALUES (940,4,'2018-10-15 15:36:32','2018-10-15 21:36:32','[mk_page_section bg_image=\"http://lincolngold-040575ad347751584312-20200909214338.local/wp-content/uploads/2016/01/IMG_3832.jpg\" attachment=\"fixed\" bg_position=\"center top\" bg_stretch=\"true\" enable_3d=\"true\" min_height=\"600\" full_width=\"true\" sidebar=\"sidebar-1\"][vc_column][/vc_column][/mk_page_section][mk_page_section bg_color=\"#b3a263\" bg_stretch=\"true\" padding_top=\"25\" sidebar=\"sidebar-1\"][vc_column width=\"2/3\"][mk_fancy_title color=\"#ffffff\" size=\"30\" font_weight=\"400\" font_style=\"normal\" txt_transform=\"none\" margin_top=\"50\" margin_bottom=\"40\" font_family=\"none\"]This year\'s Gala will take place on March 9, 2019[/mk_fancy_title][/vc_column][vc_column width=\"1/3\"][vc_empty_space height=\"40px\"][mk_button dimension=\"savvy\" size=\"large\" url=\"http://lincolngold-040575ad347751584312-20200909214338.local/gold-gala/\" align=\"center\" outline_skin=\"light\"]Reserve Your Seat[/mk_button][/vc_column][/mk_page_section][vc_row][vc_column][vc_column_text]\r\n<p style=\"text-align: center;\">Lincoln G.O.L.D. congratulates its 20 inaugural scholarship winners!</p>\r\n[/vc_column_text][vc_empty_space height=\"50px\"][/vc_column][/vc_row][vc_row][vc_column width=\"1/3\"][vc_column_text]\r\n<div class=\"\" style=\"text-align: center;\"><span class=\"\">Lincoln G.O.L.D. is a new leadership development and community engagement program for high school junior and senior girls. Lincoln G.O.L.D was formed by people who are passionate about preparing young women for success and making college more attainable for students with leadership aspirations and civic sensibilities.</span></div>\r\n<div class=\"\" style=\"text-align: center;\"><span class=\"\"></span></div>\r\n<div class=\"\" style=\"text-align: center;\"><span class=\"\">501c(3)</span></div>\r\n[/vc_column_text][/vc_column][vc_column width=\"1/3\"][vc_video link=\"https://youtu.be/-0Z4yHqgJ0s\"][/vc_column][vc_column width=\"1/3\"][vc_column_text]\r\n<h4 style=\"text-align: center;\">Board Members</h4>\r\n<div class=\"\" style=\"text-align: center;\"></div>\r\n<div class=\"\" style=\"text-align: center;\">Robin Netz, Founder &amp; Chairperson</div>\r\n<div class=\"\" style=\"text-align: center;\">Dr. Doug Netz, Nebraska Heart Institute</div>\r\n<div class=\"\" style=\"text-align: center;\">Greg Dorff, Lexus of Lincoln</div>\r\n<div class=\"\" style=\"text-align: center;\">J. Hoffman, CHI Nebraska Heart</div>\r\n<div class=\"\" style=\"text-align: center;\">Brian Wolford, Midwest Bank</div>\r\n<div class=\"\" style=\"text-align: center;\">Morgan Netz,Holmes Murphy</div>\r\n<div class=\"\" style=\"text-align: center;\">\r\n<div class=\"m_-7719981474803090244gmail-\">Sue Bath, Gallup</div>\r\n<div class=\"m_-7719981474803090244gmail-\">Meghan Ehrke, Select Style</div>\r\n<div class=\"m_-7719981474803090244gmail-\">Abbie Johnson, First Data</div>\r\n</div>\r\n<div class=\"\" style=\"text-align: center;\"></div>\r\n[/vc_column_text][/vc_column][/vc_row][vc_row][vc_column][vc_empty_space height=\"50px\"][/vc_column][/vc_row][mk_page_section bg_color=\"#b3a263\" bg_stretch=\"true\" padding_top=\"25\" sidebar=\"sidebar-1\"][vc_column width=\"2/3\"][mk_fancy_title color=\"#ffffff\" size=\"30\" font_weight=\"400\" font_style=\"normal\" txt_transform=\"none\" margin_top=\"50\" margin_bottom=\"40\" font_family=\"none\"]Now accepting scholarship applications[/mk_fancy_title][/vc_column][vc_column width=\"1/3\"][vc_empty_space height=\"40px\"][mk_button dimension=\"savvy\" size=\"large\" url=\"http://lincolngold-040575ad347751584312-20200909214338.local/scholarships/\" outline_skin=\"light\"]Apply Today[/mk_button][/vc_column][/mk_page_section][vc_row][vc_column][mk_padding_divider size=\"30\"][/vc_column][/vc_row][vc_row][vc_column][vc_column_text]\r\n<p style=\"text-align: center;\">Sponsored In Part By:</p>\r\n[/vc_column_text][mk_image src=\"http://lincolngold-040575ad347751584312-20200909214338.local/wp-content/uploads/2016/01/Lexus-of-Lincoln-Logo.jpg\" image_size=\"full\" link=\"http://www.lexusoflincoln.com/\" align=\"center\"][vc_empty_space height=\"10px\"][vc_column_text][/vc_column_text][mk_button dimension=\"savvy\" size=\"medium\" url=\"http://lincolngold-040575ad347751584312-20200909214338.local/sponsors/\" align=\"center\"]View All Sponsors[/mk_button][/vc_column][/vc_row]','Home','','inherit','closed','closed','','7-revision-v1','','','2018-10-15 15:36:32','2018-10-15 21:36:32','',7,'http://lincolngold-040575ad347751584312-20200909214338.local/7-revision-v1/',0,'revision','',0);
