INSERT INTO `681_posts` VALUES (947,4,'2018-10-16 12:15:08','2018-10-16 18:15:08','<strong>Logan Gronewold</strong>\n<ul>\n 	<li>Varsity Volleyball for 4 years</li>\n 	<li>Club Volleyball with Premier 16 Black</li>\n 	<li>\n<ul>\n 	<li>I am very proud of my success in academics. I am in the top 3% of my class.</li>\n 	<li>I truly enjoy spending time with my friends. When together, we like to spend time at the lake, pool or at each others houses watching movies on Netflix.</li>\n 	<li>I am grounded in my faith and am a member of Southwood Lutheran Church.</li>\n 	<li>I have twin brothers, one attends Northwestern University in Evanston and one attends the University of Oklahoma in Norman &amp; I live at home with my mother and father.</li>\n</ul>\n</li>\n</ul>','Logan Gronewold','','inherit','closed','closed','','899-autosave-v1','','','2018-10-16 12:15:08','2018-10-16 18:15:08','',899,'http://lincolngold-040575ad347751584312-20200909214338.local/899-autosave-v1/',0,'revision','',0);
